import { Login } from "../Layout/LoginLayout"
import { DeafaultLayout } from "../Layout/DeafaultLayout"
const publicRoutes = [
  { path: '/', component: Login },
  { path: '/home', component: DeafaultLayout
 },
 
]
const privateRoutes = []
export { publicRoutes, privateRoutes }
